import React from 'react';
import { BrowserRouter, Route, Switch} from 'react-router-dom';

//css
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

//componenti
import Layout from './componenti/Layout/layout/layout';

//pagine
import Registrazione from './pagine/Registrazione';


function App() {
  return (
    <BrowserRouter>
      <Layout>
        <Switch>
          <Route exact path='/' component={Registrazione}/>       
        </Switch>  
      </Layout>    
    </BrowserRouter>
  );
}

export default App;
